import React, { useState } from "react";
import { NavLink } from "react-router-dom";
import "./AnimatedSidebar.css";
import logoIcon from "../assets/logo-light.png";

const AnimatedSidebar = () => {
  const [open, setOpen] = useState(false);

  return (
    <>
      <input
        type="checkbox"
        id="navcheck"
        className="navcheck"
        checked={open}
        onChange={() => setOpen(!open)}
      />
      <label htmlFor="navcheck">
        <div className="burger">
          <span className="bar"></span>
        </div>
      </label>

      <nav className="sidebar-nav">
        <NavLink to="/dashboard">Dashboard</NavLink>
        <NavLink to="/profile">Min profil</NavLink>
        <NavLink to="/analyser">Mine analyser</NavLink>
        <NavLink to="/privatlivspolitik">Privatlivspolitik</NavLink>
      </nav>
    </>
  );
};

export default AnimatedSidebar;
